
<!DOCTYPE html>
<html lang="pt-br">
<head>
    <meta charset="UTF-8">
    <title>Meme Defense: Doge vs Students</title>
    <style>
        body {
            background: #121212;
            color: #fff;
            font-family: 'Arial', sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            margin: 0;
            user-select: none;
        }

        #ui-header {
            padding: 20px;
            display: flex;
            gap: 30px;
            align-items: center;
        }

        .stat-icon {
            width: 30px;
            height: 30px;
            vertical-align: middle;
            image-rendering: pixelated;
        }

        #game-container {
            display: flex;
            gap: 20px;
            background: #222;
            padding: 20px;
            border-radius: 15px;
            border: 4px solid #444;
        }

        /* Grade de Invent√°rio */
        .grid {
            display: grid;
            grid-template-columns: repeat(3, 85px);
            gap: 10px;
        }

        /* Slots de Defesa */
        #defense-slots {
            display: flex;
            flex-direction: column;
            justify-content: space-around;
            background: #333;
            padding: 10px;
            border-radius: 10px;
            border-right: 4px dashed #666;
        }

        /* Campo de Batalha */
        #field {
            width: 450px;
            height: 320px;
            background: #1a1a1a;
            position: relative;
            overflow: hidden;
            border-radius: 10px;
        }

        .slot {
            width: 85px;
            height: 85px;
            background: #2a2a2a;
            border-radius: 8px;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        /* Estilo dos Personagens */
        .sprite {
            width: 75px;
            height: 75px;
            background-size: contain;
            background-repeat: no-repeat;
            background-position: center;
            image-rendering: pixelated;
            cursor: grab;
        }
